import React, {Component} from 'react'

class SelectCharacters extends Component {
    constructor(props){
        super(props)
        this.state = {}
        this.characters = "abcdefghijklmnopqrstuvwxyz12367890"
    }

    createCharacters = () => {
        return this.characters.split(" ").map((char)=> {
            return (
            <button id={char} onClick={(e)=>{console.log(char)}}>char</button>
            )
        })
    }

    render(){
        return (
            <div>
                {this.createCharacters()}
            </div>
        );
    }
}

export default SelectCharacters
